INSERT INTO `shop` VALUES (1,'鼎天家居','http://tenpp.com/JJ/JJCS_1_1_8.gif','http://img02.taobaocdn.com/imgextra/i2/813901784/T2gOdsXi8MXXXXXXXX_!!813901784.jpg','18651005960','0510-6999999','果园路28号新生活家居广场3楼A区15号','2路、1路',255,'  佛山市赛格卫浴卫浴有限公司是一家专业生产陶瓷卫生洁具及卫浴配套产品的大型企业，公司自成立以来受到了业内人士的大力支持和行业界的一致好评。 公司以“诚、勤、新、精”为经营理念，树立公司高品质的企业形象；坚持“天天都是3.15，无惧时间的考验，品质依然保证”的经营承诺；以“领导有情、管理无情、制度绝情”的管理方针，荣获高标准的“ISO9001优质管理企业”称号；基于“产品决定人品、人品决定产品”的认识，采取不定期举办讲座等方式提高员工的文化素质；以“赛出皎皎风格”为企业精神，以“作出真正实质的卫浴”为奋斗目标。在建陶同行、社会各界的亲切关怀和大力支持下，赛格卫浴在行业中取得硕果累累，见证了无数荣誉：在同行业中率先通过ISO-9001国际质量管理体系认证，获得“中国卫生陶瓷协会会员单位”、荣获“国家质量检测合格产品”称号、荣获“国际标准产品标志”证书、荣获“中国绿色建筑陶瓷”称号、荣获“中国名优产品和行业十佳知名品牌”称号、荣获“中国著名品牌”称号,赛格卫浴商标已先后在香港、台湾及海外等地进行商标注册。 赛格卫浴以“简约、时尚、完美”为设计理念，以源自欧洲的时尚元素与悠久的东方文化相结合，既有休闲、自然的独特品牌特征，又紧跟个性、时尚的世界卫浴流行脉搏；以休闲卫浴为主导产品，配套发展风格统一的浴缸、淋浴房、水龙头、挂件等卫浴系列，倡导整体配套的卫浴概念，营造出一个缤纷多彩、风格鲜明的卫浴世界；产品采用天然的优质原料，运用精细、多样的生产工艺，生产出真正实质的卫浴产品，向人们展示了阴阳调和的永恒主题和天地合一这一古老东方文化，既有西方都市的时尚与前卫，又有东方田园的自然与雅致。 赛格，是一个品牌，更是一种文化！我们期待更多的合作伙伴走进赛格，了解赛格，传播赛格文化，实现品牌国际化，让不同民族、不同信仰消费的群体分享我们的快乐！ 赛格卫浴－－赛出皎皎风格，见证完美人生！','个体经营','赛格','http://苏旭.to8to.com','卫浴设备','蹲便器,坐便器,浴缸,台盆,淋浴花洒,卫浴龙头,卫浴柜,卫浴五金','2012-08-28 00:00:00','何经理');
